import React, { Component } from 'react';
import '../../../scss/Chips.scss';
import Chip from '@material-ui/core/Chip';

const Style = {
    backgroundColor: 'purple',
    color: 'white'
};

export default class Chips extends Component {
    render() {
        return (
            <Chip label="Bootstrap" size="small" style />
        );
    }
}
